import React, { useState, useEffect } from 'react';
import './Hero.css';

const AnimatedText = ({ children, delay = 0 }) => {
  const [visible, setVisible] = useState(false);

  useEffect(() => {
    const timer = setTimeout(() => setVisible(true), delay);
    return () => clearTimeout(timer);
  }, [delay]);

  return (
    <div className={`transition-all duration-1000 ${visible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-8'}`}>
      {children}
    </div>
  );
};

const Hero = () => {
  const [mousePos, setMousePos] = useState({ x: 0, y: 0 });

  useEffect(() => {
    const handleMouseMove = (e) => {
      setMousePos({
        x: (e.clientX - window.innerWidth / 2) / 200,
        y: (e.clientY - window.innerHeight / 2) / 200
      });
    };

    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  return (
    <div className="min-h-screen relative overflow-hidden">
      {/* Animated Gradient Background */}
      <div className="fixed inset-0 -z-10">
        <div className="absolute inset-0 bg-gradient-to-br from-purple-50 via-blue-50 to-cyan-50"></div>
        <div 
          className="absolute inset-0 opacity-30"
          style={{
            transform: `translate(${mousePos.x}px, ${mousePos.y}px)`,
            transition: 'transform 0.8s ease-out'
          }}
        >
          <div className="absolute top-20 left-20 w-72 h-72 bg-gradient-to-r from-purple-300 to-blue-300 rounded-full opacity-40 animate-pulse blur-xl"></div>
          <div className="absolute bottom-20 right-20 w-96 h-96 bg-gradient-to-r from-blue-300 to-cyan-300 rounded-full opacity-40 animate-bounce blur-xl" style={{ animationDuration: '4s' }}></div>
          <div className="absolute top-1/2 left-1/3 w-64 h-64 bg-gradient-to-r from-cyan-300 to-teal-300 rounded-full opacity-40 animate-ping blur-xl" style={{ animationDuration: '3s' }}></div>
        </div>
      </div>

      {/* Hero Content */}
      <main className="max-w-7xl mx-auto px-6 pt-32 pb-16 relative">
        <div className="flex items-center justify-between min-h-[80vh]">
          <div className="max-w-2xl relative z-10">
            <AnimatedText delay={500}>
              <span className="inline-block px-6 py-3 bg-gradient-to-r from-purple-100 to-blue-100 text-purple-700 rounded-full text-sm font-semibold mb-6 animate-bounce shadow-lg">
                🚀 Welcome to the Future of Work
              </span>
            </AnimatedText>
            
            <AnimatedText delay={800}>
              <h1 className="text-7xl font-black mb-6 leading-tight">
                <span className="bg-gradient-to-r from-purple-600 via-blue-600 to-cyan-600 bg-clip-text text-transparent">
                  Welcome to
                </span>
                <br />
                <span className="bg-gradient-to-r from-cyan-600 via-blue-600 to-purple-600 bg-clip-text text-transparent animate-pulse">
                  SkillsFusion
                </span>
              </h1>
            </AnimatedText>
            
            <AnimatedText delay={1200}>
              <p className="text-xl text-gray-600 leading-relaxed mb-8 max-w-lg">
                Connecting talent with opportunity seamlessly. Experience the future of freelancing with cutting-edge technology and limitless possibilities.
              </p>
            </AnimatedText>
            
            <AnimatedText delay={1600}>
              <div className="flex gap-4 mb-8">
                <button className="group px-8 py-4 bg-gradient-to-r from-purple-600 to-blue-600 text-white font-bold rounded-full shadow-xl hover:shadow-2xl transition-all duration-300 transform hover:scale-105 hover:from-purple-700 hover:to-blue-700 relative overflow-hidden">
                  <span className="relative z-10">Get Started</span>
                  <div className="absolute inset-0 bg-gradient-to-r from-white/20 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300"></div>
                </button>
                <button className="px-8 py-4 border-2 border-purple-200 text-purple-600 font-bold rounded-full hover:bg-purple-50 transition-all duration-300 transform hover:scale-105 hover:shadow-lg">
                  Learn More
                </button>
              </div>
            </AnimatedText>
          </div>

          {/* Optional: You can add a visual or animation component on the right */}
          <div className="relative">
            {/* Right side placeholder */}
          </div>
        </div>
      </main>
    </div>
  );
};

export default Hero;
